import React from "react";
import UseState from './UseState';
const Register = ({name}) =>{
    if(name !== "user"){
        throw new Error("something went wrong!!")
    }
    return(
        <div>
            <h2>Register {name}</h2>
            <UseState/>
        </div>
    )
}
export default Register
